svg.script:

function init(evt)
{
	svgDoc  = evt.target.ownerDocument;
	svgRoot = svgDoc.rootElement;
}
function mOver(evt)
{
    var rect=evt.target;
	rect.style.cursor = "hand";
}
function mOut(evt)
{
    var rect=evt.target;
	rect.style.cursor = "default";
}
function mClick(evt)
{
    var rect=evt.target;
	alert("id="+rect.id);
}
